float normalizeAngle(float theta) {
  int k = (int)(theta / TWOPI);
  theta -= k * TWOPI;
  if (theta < 0) theta += TWOPI;
  return theta;
}

float sin(float theta) {
  theta              = normalizeAngle(theta);
  float idx          = theta * ((float)TRIG_LOOKUP_SIZE / TWOPI);
  int tableIdxLower  = (int)idx;
  int tableIdxHigher = (tableIdxLower + 1) % TRIG_LOOKUP_SIZE;
  float t            = idx - (float)tableIdxLower;
  return _sinLookup[tableIdxLower] * (1 - t) + _sinLookup[tableIdxHigher] * t;
}

float cos(float theta) {
  return sin(theta + HALFPI);
}

float sind(float theta) {
  return sin(theta * DEG2PI);
}

float cosd(float theta) {
  return cos(theta * DEG2PI);
}
